import styled from "styled-components";

export const Container = styled.div`

    display: flex;
    width: 100%;
    height: 100%;
    justify-content: center;
    align-items: center;
`;

export const PokemonInput = styled.input`
    width: 80%;
    height: 30%;
    display: flex;
    border: 2px solid #555;
    border-radius: 9px;
    font-size: 100%;
    text-indent: 10px;
    box-sizing: border-box;
    outline: 0;
`
